import React, {useState, useEffect} from "react";
import "./projects.scss"
import ProjectBox from "./projectBox/projectbox"
import projectData from "./projectData.json"

const project = projectData.projects;
const [meanValue,setMeanValue] = useState(0);
const Projects = () =>{
    return (
        <section>
            <div className="header">
                <h1>My Projects</h1>
            </div>
        
            <div className="projectBoxes">
                {project.map(projects=>(
                    setMeanValue=meanValue + projects.number,
                    console.log("här"+projects.number),
                    <ProjectBox title={projects.title} logo={projects.logo}/>
                ))}
            </div>
            {console.log("mean value" + meanValue)}
        </section>
        );
}
export default Projects;
